//
// Ask the user the latitude
//

val station = z.input("Station id","29200008").toString
z.put("stationIdToWatch",station)

import org.apache.commons.io.IOUtils
import java.net.URL
import java.nio.charset.Charset

//
// Convert ticks Scala object to a Long Array
//
val ticks = z.get("serieToWatchTS").toString.replace("[","").replace("]","")
val ticksArray = ticks.split(", ").map(_.toString.toLong)

//
// Convert values Scala object to a Long Array
//
val values = z.get("serieToWatchValues").toString.replace("[","").replace("]","")
val valuesArray = values.split(", ").map(_.toString.toDouble)

//
// Save data in String format
//
var str = ""
for (i <- 0 until z.get("nbPointsCurrentSerie").toString.toInt) {
   str += (ticksArray(i)/1000000) + ";" + valuesArray(i) + "\n"
}
val serieText = sc.parallelize(str.split("\n"))

//
// Inject object in a data-frame in Spark context
//
case class StationPrice(timestamp: Long, price: Double)

//
// Creat one object for each line contained in text
//
val stations = serieText.map(s => s.split(";")).map(
    s => StationPrice(s(0).toLong, 
            s(1).toDouble
        )
).toDF()
//print(stations)
stations.registerTempTable("tableStations")
